(5, 'Giant Telephone KECHAODA 888 3 SIM Phone for the Elderly - OHNO Vietnam', '<p>Kechaoda K888 is a unique phone with an extremely impressive design.</p>\r\n\r\n<p>The exterior looks like a walkie-talkie with a large, clear numeric keypad, very suitable for the elderly to use at home, or as a hotline number for the company.</p>\r\n\r\n<p>The size of the Kechaoda 888 is quite large 19.6 x 7.45 x 1.0 cm (length x width x thickness).</p>\r\n\r\n<p>Above is equipped with an antenna that allows extremely good reception.</p>\r\n\r\n<p>Kechaoda K888 is designed to be a 3-sim phone with a strong black appearance.</p>\r\n\r\n<p>Extremely large battery capacity up to 4000 mAh, allowing you to use from 4-7 days, not only that it can also support charging for other phones.</p>\r\n\r\n<p>In addition, the Kechaoda K888 is equipped with a huge speaker strip on either side of the body with extremely standard Bass, allowing you to use it for listening to music, FM, etc. like a real speaker.</p>\r\n\r\n<p>Especially in Kechaoda K888 is also equipped with Bluetooth Partner feature, allows users to connect to the Smartphone to comfortably listen to calls, mp3 ... etc ..</p>\r\n\r\n<p>The top of the device is also equipped with a super flashlight, allowing you to use it as a flashlight. batteries in times of need. Address (at the unified intersection of Nguyen Van Luong) - Alley 269/3, Thong Nhat Street, Ward 11, Go Vap City, Ho Chi Minh City Lh: 0868959747 - 0909809928 web: 2tekvn.net - loakeodidong.net</p>', 'giant_phone_1.jpg', 599000, 30, 30, '2020-12-14', 0, 0, 1, 6, 10, 1, 0),
(6, 'Vsmart Live Phone 4 6GB / 64GB - Genuine', '<p>ULTIMATE CONFIGURATION BIRED FOR ENTERTAINMENT</p>\r\n\r\n<p>Developed by Qualcomm for endless entertainment, Snapdragon 675 chip delivers smooth experience as well as minimizes lag, giving Live 4 the power of performance segment leading performance!</p>\r\n\r\n<p>EXPERIENCE ULTIMATE ENTERTAINMENT WITH 6.5 &rdquo;FLOOR SCREEN</p>\r\n\r\n<p>The Live 4 display expands to 6.5&rdquo; with a stylish, sophisticated perforated design. From there, maximizing the display space, ensuring a complete experience for the best combat scenes or excellent action movie scenes.</p>\r\n\r\n<p>Set of 4 IMPRESSIVE AI Cameras Enjoy capturing vivid and sharp fanciful night moments with 48MP night camera. Make every scene more majestic and vivid with up to 1200 wide-angle 8MP camera.</p>\r\n\r\n<p>Close-ups have never been easier with the 2MP macro camera.</p>\r\n\r\n<p>Possessing impressive font deletion photos with 5MP font removal camera.</p>\r\n\r\n<p>LUXURY COLOR More than a trusted &quot;comrade&quot; in the entertainment arena, Live 4 also shines as a classy fashion accessory, helping you to always maintain the spirit of elegance and personality.</p>\r\n\r\n<p>TRUE TU VIET VOS is the own operating system of Vsmart phones, completely researched and developed by a team of Vietnamese engineers to bring an optimized product in both hardware and software.</p>\r\n\r\n<p>Latest 3.0, Live 4 is equipped with advanced security technology, an extensive theme store and keyboard optimized for each set interface - sure to give you a convenient and convenient experience.</p>\r\n\r\n<p>Intelligent Design Details Color: Emerald Green, Turquoise Black, Crystal White Size: 162.4 mm x 76.5 mm x 8.</p>', 'vsmart_1.jpg', 4190000, 30, 27, '2020-12-14', 0, 0, 1, 8, 10, 1, 0),
(7, 'Xiaomi Redmi Note 8 Pro 64GB Ram 6GB - Imported', '<p>5 mm Other connections</p>\r\n\r\n<p>OTG Design &amp; Weight Monolithic Design Material: Plastic</p>\r\n\r\n<p>Frame &amp; Back Dimensions: Length 164.1 mm - Horizontal 75.5 mm - Thickness 8.5 mm</p>\r\n\r\n<p>Weight: 188 g</p>\r\n\r\n<p>Battery &amp; Charger Battery type: Li- Po</p>\r\n\r\n<p>Battery capacity: 5000 mAh</p>\r\n\r\n<p>Battery technology: Fast battery charging Following the cult duo Realme 7 and Realme 7 Pro, Realme has officially added a new member Realme 7i with a more attractive price.</p>\r\n\r\n<p>However, Realme&#39;s new smartphone still retains impressive parameters such as a smooth 90 Hz screen, a bright 64 MP night camera with performance from the Snapdragon 662 that promises a smooth and stable experience.</p>\r\n\r\n<p>A luxurious, outstanding appearance Similar to the elder, the Realme 7i also has a glossy and flashy appearance, all attention is focused on the daring diagonal line and impressive light effects when tilting the camera below. multiple angles.</p>\r\n\r\n<p>Realme 7i feels quite comfortable, light with 4 curved edges, the back is made of plastic for lighter weight, while the front is protected by Gorilla Glass 3 to prevent maximum damage to the screen when dropped or knocked over.</p>\r\n\r\n<p>On the front, the Realme 7i has a super bezel-less screen with a trendy perforated camera, helping to expand the entertainment space up to 6.5 inches but still compact for you to put in your pocket or bag when you carry it with you. me.</p>\r\n\r\n<p>A distinguishing point on the Realme 7i is that the Realme 7i will still have fingerprint security features with the sensor placed on the back instead of next to it like Realme 7.</p>\r\n\r\n<p>This sensor has fast recognition speed, taste. location is suitable for you to place your finger for easy unlocking. Strong configuration war game &quot;top&quot; than If you are a fanatic of mobile games, Realme 7i will be an option to try.</p>\r\n\r\n<p>It is equipped with a mid-range Snapdragon 662 processor optimized for gaming to ensure all tasks are processed quickly, integrated GPU 610 enough for you to play games smoothly at stable frame rates.</p>\r\n\r\n<p>Besides, this is also a processor running on 11 nm process with 8 cores to provide more powerful performance but consumes less power.</p>\r\n\r\n<p>Realme 7i is capable of multitasking no less than today&#39;s high-end smartphones thanks to 8 GB RAM. And there&#39;s 128 GB of built-in storage for you to comfortably store whatever you want.</p>\r\n\r\n<p>The 90 Hz screen enhances the experience Realme continues to set a new refresh rate standard when bringing the 90 Hz screen to the Realme 7i.</p>\r\n\r\n<p>Compared with the normal 60 Hz frequency, the 90 Hz screen increases the number of images displayed per second by 50%, providing a very smooth motion effect every time you swipe, experience like on an expensive high-end phone.</p>\r\n\r\n<p>In addition, the large 6.5-inch screen with an edge-to-edge design, the front-facing aspect ratio is up to 90%, so you can immerse yourself in great movies while playing games, perfect with a wide range of colors.</p>\r\n\r\n<p>Show honesty, eye-catching, good viewing angle from IPS LCD panel.</p>\r\n\r\n<p>64 MP camera with terrible definition, dispelling the night Not inferior to the seniors, Realme 7i is also equipped with 3-sensor cluster with a resolution of up to 64 MP, giving you the freedom to explore, record events, moments are going around on its own accord. Featured is the main sensor on Realme when there is a super-sharp capture mode with 64 million pixels that delivers incredibly sharp, high-resolution photos so impressive that you can print photos taken from Realme 7i on one surface. Large side like outdoor advertising panel without worrying about tank shape.</p>\r\n\r\n<p>Built-in EIS image stabilization on both front and rear cameras helps to reduce shake when shooting videos by hand, for smooth, steady vblog footage, frame-by-frame, even when you&#39;re in motion.</p>\r\n\r\n<p>WARRANTY NEWS: Product is warranted for 12 months at the REALME 1 warranty center for 1 for the first 30 days of use (Manufacturing error). Hotline: 1800 6067 (free).</p>\r\n\r\n<p>Package information: - Realme 7i phone - USB Type-C charging cable - 18W fast charger - Sim stick - Screen protector, user manual, case - Important product information and warranty Products are warranted for 12 months at the REALME 1 for 1 in the first 30 days of use (manufacturing defect).</p>\r\n\r\n<p>Hotline: 1800 6067 (free).</p>\r\n\r\n<p>Package information: - Realme 7i phone - USB Type-C charging cable - 18W fast charger - Sim stick - Screen protector, user manual, case - Important product information and warranty Products are warranted for 12 months at the REALME 1 for 1 in the first 30 days of use (manufacturing defect).</p>\r\n\r\n<p>Hotline: 1800 6067 (free). Package information: - Realme 7i phone - USB Type-C charging cable - 18W fast charger - Sim stick - Screen protector, user manual, case - Important product information and warranty</p>', 'xiao.jpg', 4130000, 10, 10, '2020-12-14', 0, 0, 1, 4, 10, 1, 0),
(8, 'Nokia 105 Dual SIM Phone (2 sim) - Genuine product', '<p>Nokia 105 2 Sim Phone (2019) - Genuine Product</p>\r\n\r\n<p>Package includes: Body, battery, charger, user manual.</p>\r\n\r\n<p>Chat with people with the latest phone.</p>\r\n\r\n<p>Longer battery life keeps you connected for longer, along with a rounded design for a great in-hand experience, ensuring you&#39;re always comfortable for extended chats.</p>\r\n\r\n<p>The polycarbonate case gives you a stylish and solid product that holds color well even when scratched.</p>\r\n\r\n<p>Talk time all day. Durable battery for long active days.</p>\r\n\r\n<p>Modern design with high durability results in a product design that is strong and perfect in the hand.</p>\r\n\r\n<p>Sturdy design, the product is always sturdy and withstands impact endurance.</p>\r\n\r\n<p>Press the correct buttons. Keypad with individual keys for easy pressing. Products with storage capacity up to 2. 000 regular contacts and 500 text messages.</p>\r\n\r\n<p>And when you&#39;re not chatting, relax with a few games or listen to the radio.</p>\r\n\r\n<p>Nokia 105 2 Sim (2019) - Genuine Product - Hong Hanh Mobile Thank you for your interest in the shop&#39;s products, please take a little time to read carefully the return warranty policy:</p>\r\n\r\n<p>- Product Tested for 7 days from the date of receiving the product and will be replaced with a new device with the same model or equivalent value after being assessed for technical defects.</p>\r\n\r\n<p>- Product technical defects confirmed by a genuine authorized warranty center (in writing); Customers can return to the shop to confirm the error or to the nearest warranty station to verify the error.</p>\r\n\r\n<p>- Returned product must be in the original state of the device, not scratched, not broken, in water, broken sim leg, memory card frame ... (all external effects from the customer are DISCLAIMER)</p>\r\n\r\n<p>- Returned product must still have the same imei box, accessories attached to the machine are not scratched, explosion, broken wire (if scratches the shop does not change new accessories)</p>\r\n\r\n<p>- After 7 days of testing, the product still receives a 12-month warranty policy from the date of purchase (customer is responsible for shipping to the warranty shop or go to the nearest warranty center. for support)</p>\r\n\r\n<p>- Product is DISCLAIMER in case of fire, explosion, breakage, external impact on body and inside of machine, there is change to repair outside.</p>\r\n\r\n<p>- Products locked accounts such as Gmail, Samsung account ... Customers are required to pay for the unlocking fee if they do not remember the password.</p>\r\n\r\n<p>&nbsp;</p>', 'nokia_dual_sim_1.jpg', 340000, 50, 50, '2020-12-14', 0, 0, 1, 6, 10, 1, 0),
