(20, 'Solar power bank 20,000 mAh.h', '<p>20000 mAh solar power bank cum super bright flashlight</p>\r\n\r\n<p>With the 20000 mAh solar power bank you will not have to fear your phone is always in a low battery state, which makes you feel uncomfortable.</p>\r\n\r\n<p>Designed with an alloy frame and ABS plastic to help the product withstand and beat and extremely durable.</p>\r\n\r\n<p>With attractive appearance and strong performance, the Solar Power bank 20,000mAh will be a good partner for your mobile phone as well as other mobile devices.</p>\r\n\r\n<p>Product information: Solar Charger Solar Charger:</p>\r\n\r\n<p>1. Designed capacity 20000mAh, (divided by 2 ports), can be recharged under sunlight.</p>\r\n\r\n<p>2. With 2 USB charging ports, compatible with all Smartphones.</p>\r\n\r\n<p>3. Small design and high portability easy to use.</p>\r\n\r\n<p>4. Indicator light during charging discharge.</p>\r\n\r\n<p>5. Convenient easy to use.</p>\r\n\r\n<p>6. Key chain included, so you can attach it to your backpack.</p>\r\n\r\n<p>7. Waterproof, shockproof, anti-dust.\r\n</p>\r\n<p>8. Integrated BATTERY used in an emergency in the dark.</p>\r\n\r\n<p>9. Build-in Design Explosion-proof, lightweight, compact and reliable Lithium Polymer Battery.</p>\r\n\r\n<p>10. Long service life up to more than 1,000 charges. Especially, you can easily carry it on the go with a light weight of ~ 300g. Moreover, the colors are designed to be extremely youthful and friendly.</p>\r\n\r\n<p>The solar power bank is a high-end rechargeable battery that fully charges most phones and tablets.</p>\r\n\r\n<p>- Automatically disconnect the power when the battery is full, protect the battery</p>\r\n\r\n<p>- Stable current for the battery and the phone</p>\r\n\r\n<p>- There are THREE ways to charge the battery is very convenient and easy to use.</p>\r\n\r\n<p>- Not afraid of running out of battery when traveling for business, playing games, surfing the web, travel ... 20000 mAh solar power bank technology Polymer battery core for capacities up to 20,000mAh through 4W - 200mA solar panels.</p>\r\n\r\n<p>With charging efficiency of about 80%, continuous charging is not afraid of running out of power. The 20000 mAh solar power bank can be recharged easily by exposure to the sun.</p>\r\n\r\n<p>In addition, the Solar 20,000mah backup battery can also be charged by a conventional method that is charging with a current of 220V or connected to a computer via a USB port.</p>\r\n\r\n<p>20000 mAh solar power bank with 4 above charging ways, the battery will have different full charge times: 3 hours for direct charging via socket, 6 hours for charging via USB port linked to the computer Solar charger and fluorescent lamp will have full time depending on the intensity of light that the light brings.</p>\r\n\r\n<p>20000 mAh solar power bank capable of stable current transmission.</p>\r\n\r\n<p>#Pinsacduphong #sacduphong #sacmattroi,</p>\r\n\r\n\r\n\r\n', 'battery_sun_1.jpg', 229000, 20, 20, '2020-10-27', 0, 0, 1, 5, NULL, 1, 0),
