(37, 'Combo mic livestream singing karaoke card V8 with autotune micro BM900 WOAICHANG GIVE ear 450', '<p>The set includes:</p>\r\n\r\n<p>1. Sound card V8</p>\r\n\r\n<p>2. micro BM900 WOAICHANG</p>\r\n\r\n<p>3. Micro clamping pin</p>\r\n\r\n<p>4. POP Filter sound filter</p>\r\n\r\n<p>5. 3.5mm wire for music, micro cotton filter and full accessories. Some interesting things about the sound card v8 Sound card roughly understood as &quot;Card&quot; Sound means a device used to receive, process and transmit sound signals through another peripheral device. The sound in the computer is in digital form (digital) to be able to transmit well to the outside requires a digital to analog converter (signal band) so Sound card V8 helps your computer to do that. V8 sound card is a sound card product that is compatible with many devices such as smartphones, laptops, pc, and tablets. With the feature of distorting vocals, into children&#39;s voices, the elderly, Ability to insert sound effects into recordings such as applause, cheers, cheers, birds chirping ...</p>\r\n\r\n<p>With 12 sound effects, it will give you a very enjoyable recording experience.</p>\r\n\r\n<p>Specifications of the V8 Sound card Sound card</p>\r\n\r\n<p>Channel number: 2in / 2out</p>\r\n\r\n<p>Microphone frequency: -42db +/- 1db</p>\r\n\r\n<p>SNR:&gt; 105dB (output) -&gt; 88db (input)</p>\r\n\r\n<p>Dynamic Range:&gt; 104db 20Hz-20kHz</p>\r\n\r\n<p>Frequency response number: 0 + / -0.3db, 20Hz - 20kHz</p>\r\n\r\n<p>Power supply: 5v-0.5A</p>\r\n\r\n<p>Power: 4.0w</p>\r\n\r\n<p>Operating temperature: 0-50 * C</p>\r\n\r\n<p>Allowable humidity: &lt;40%</p>\r\n\r\n<p>Recording parameters: 24bit / 48kHz</p>\r\n\r\n<p>Product weight: 400g</p>\r\n\r\n<p>Dimensions: 130x 110x 27 mm</p>\r\n\r\n<p>Power storage battery in sound card, lithium battery: 1000 mA (can be used continuously for 5 hours power failure)</p>\r\n\r\n<p>6 months warranty</p>\r\n\r\n<p># v8 # soundcardv8 # soundcard #Soundcardthuam #Bothuam # Bothuamv8