(58, 'Huawei Matebook D 15 laptop (8GB / 256GB)', '<p>Adapter Type PIN seamless</p>\r\n\r\n<p>PIN Model Adapter HW-200325UPO</p>\r\n\r\n<p>Information 3-cell Li-ion battery</p>\r\n\r\n<p>Operating system Windows 10 Home SL</p>\r\n\r\n<p>Dimensions &amp; weight Dimensions Length 357.8 mm - Width 229.9 mm - Depth 16.9 mm Weight 1.62 kg</p>\r\n\r\n<p>Material Monolithic metal housing</p>\r\n\r\n<p>More Information Launch time 2020 Luxurious design - class Huawei MateBook D15 offers a flawless design with unibody metal, slim and light body for optimal mobility.</p>\r\n\r\n<p>Weighing just 1.62 kg - 16.9 mm thick, Huawei MateBook can accompany you anytime, anywhere you want. Ideal Performance for Work and Entertainment The Huawei MateBook D15 uses the AMD Ryzen 5 chip to accelerate and boost performance. 8 GB RAM makes multitasking smooth, limiting the stutter and lag when opening multiple tabs.</p>\r\n\r\n<p>AMD Radeon Vega 8 Graphics graphics card offers better graphics quality, you can play today&#39;s popular games such as LOL, FIFA at medium to high configurations, Fortnite at low configuration. With this configuration, you can work in the office, study, entertain and create freely with graphic applications such as Photoshop, Ai, ... or simple video editing, video editing in Premiere.</p>\r\n\r\n<p>Enjoy the stunning full screen display Huawei equips the MateBook D15 with a 15.6-inch FullView display with ultra-thin bezels, providing an 87% screen-to-body ratio for a stunning and eye-catching viewing experience. The screen has a resolution of Full HD and IPS technology provides sharp images, true colors and good contrast, this is also the condition for you to do graphics or edit images. be more precise in color.</p>\r\n\r\n<p>TUV Rheinland-certified monitors reduce blue light that is harmful to eyes, protecting your eyes during long periods of use. Dolby Audio technology for vivid sound quality along with the ability to simulate surround sound gives the listener the feeling of being immersed in the world of music.</p>\r\n\r\n<p>Huawei Share - One-touch sharing Exchange information between your smartphone and laptop is easier than ever with the Huawei Share feature on the MateBook D15. When two devices are connected, a phone screen appears on your laptop, allowing you to drag and drop files between the two devices and edit files on the computer while texting with colleagues. on your phone using the same computer keyboard and mouse.</p>\r\n\r\n<p>Hidden camera for privacy Huawei offers an innovative camera design hidden under a keyboard that can press to open and press again to hide the camera. This feature helps users to be more proactive in controlling information, limiting image theft for malicious purposes. The laptop has a fingerprint sensor integrated on the power button for you to easily log in with just one touch, increasing the security of information on the machine.</p>\r\n\r\n<p>The MateBook D5 has all the common ports in a slim and light body, making connection easy, and sharing data quickly. The MateBook D15 comes with a convenient USB Type-C charger, built in fast charging. Computers can be charged to 53% in just about 30 minutes (according to the company announced) to help you not worry about interrupting work.</p>', 'huawei_laptop_1.jpg', 14990000, 20, 20, '2020-12-15', 0, 0, 3, 3, NULL, 1, 0),
