(61, 'Apple Macbook Air 13 inch 2020 Laptop Core i3 Gen10 8GB 256GB SSD - Imported goods', '<p>Highlights of the new 13-inch 2020 MacBook Air</p>\r\n\r\n<p>1. Magic Keyboard Besides the 2020 iPad Pro with a brand new Magic Keyboard, Apple today also announced a new MacBook Air 2020 with a keyboard. Redesigned, as well as upgraded the performance and configuration of the device significantly compared to its predecessor With the new MacBook Air 2020, this will be the next MacBook line that Apple removes the next-generation butterfly keyboard design. old has been complained by many for durability, replaced with a newer scissor design similar to the keyboard of the new 16-inch MacBook Pro released late last year (same 1mm key travel and reverse T-shaped arrow keys) .</p>\r\n\r\n<p>2. 10th Gen Intel chip The new Air series also significantly improves performance when it equips Apple with the 10th generation Intel chip, which according to Apple promises to bring performance doubled compared to the old generation. The highest-end version that users can choose from will come with a quad-core 1.2GHz Intel Core i7 quad-core chip and 16GB of RAM. In addition, Apple has also started to equip integrated graphics card Iris Plus Graphics for the Air line this year, bringing the graphics processing capacity up to 80%.</p>\r\n\r\n<p>3. Powerful Upgraded Memory Yet, MacBook Air 2020 also completely removes the basic 128GB memory version, instead the standard version will have a 256GB capacity, and users can completely choose to upgrade. Up to 2TB memory for the new Air, of course the price will be &quot;team&quot; up quite a lot for the upgrade. Apple has also started to equip Iris Plus Graphics integrated graphics for the Air line this year, bringing the graphics processing capacity up to 80%.</p>\r\n\r\n<p>3. Powerful Upgraded Memory Yet, MacBook Air 2020 also completely removes the basic 128GB memory version, instead the standard version will have a 256GB capacity, and users can c