(74, 'USB brand HP many options capacity from 16GB-1TB with Android port adapter', '<p>Estimated delivery time for this product is 7-9 days Standard USB interface, usable for all computers to provide secure data storage, outstanding storage performance, plug and use immediately, convenient and fast. Can be used for PC to store videos, music, pictures, file data, to achieve efficient mobile and computer data sharing, safe and convenient</p>\r\n\r\n<p>Model: HP v250w Color : Silver</p>\r\n\r\n<p>Storage capacity: 16GB 32GB 64GB 128GB 256GB 512GB 1TB</p>\r\n\r\n<p>Features: Creative keyring design Size: (height x width x length) 5mm x 15.8mm x 46.6mm</p>\r\n\r\n<p>Net weight: 11.5g</p>\r\n\r\n<p>Interface type: USB 2.0</p>\r\n\r\n<p>Operating system: Win98 / ME / 2000 / XP / Vista / win7 / Win8 ... Mac OS 9 X / Linux2.4 O above</p>\r\n\r\n<p>USB connection: Support plug and use immediately</p>\r\n\r\n<p>Product life: More than 10 years</p>\r\n\r\n<p>&bull; Exterior design in silver-gray, capless silver-gray alloy</p>\r\n\r\n<p>&bull; Innovative key chain design helps USB securely attach to keys, backpacks, bags ...</p>\r\n\r\n<p>&bull; 128GB version with large capacity and exclusive permission.</p>\r\n\r\n<p>&bull; 100% sealed design, perfectly meets your everyday usage requirements: Dustproof, shockproof, anti-static, anti-magnetic, high temperature Package includes: 1 HP brand USB 1 head Android Converter (For Android phones)</p>\r\n\r\n<p>#USB #Flashdrive #Udisk #Pendrive # 1TB #Metal #Portable #HP</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 'hp_usb_1.jpg', 115000, 10, 10, '2020-12-15', 0, 0, 3, 7, NULL, 1, 0),
(75, 'USB 3.1 SanDisk Ultra Fit CZ430 256GB 130MB / s - 5 years warranty', '<p>5-year 1-for-1 warranty Part number: SDCZ430 USB standard 3.1 Compact design Capacity 256 GB Read speed 130MB / s Color Black Device up to 256GB allows you to comfortably store data like : Music, pictures, videos, documents, software, ... The product is compatible with most of the current operating systems.</p>', 'san_disk_usb_1.jpg', 699000, 20, 20, '2020-12-15', 0, 0, 3, 4, NULL, 1, 0),
(76, '[32 / 64GB] USB OTG Sandisk iXpand Mini for Iphone Ipad - USB for Iphone', '<p>Why it takes 2 million VND to expand the capacity only for 64GB, while only 850k for USB 64GB but also to use with many other iOS devices (Best price VN). ‚ñà Reasons you should choose the Sandisk iXpand Mini OTG for Iphone Ipad USB:</p>\r\n\r\n<p>‚úî Super unique and compact design that plugs directly into your iPhone or iPad without having to remove the case.</p>\r\n\r\n<p>‚úî USB 3.0 lets you transfer files a lot easier and faster than USB 2.0</p>\r\n\r\n<p>‚úî The exclusive SanDisk iXpand Drive app makes it easy to manage your photos, videos, and files and play them directly on the drive.</p>\r\n\r\n<p>‚úî Free up storage space on your iPhone or iPad quickly and easily with the USB Sandisk iXpand Mini OTG.</p>\r\n\r\n<p>‚úî Automatically backup your photos and take high-quality video directly on iXpand.</p>\r\n\r\n<p>‚úî Easy to use and ultra-fast connection allows you to easily move photos, videos, and other files without messy cables. In addition, you can also move these files to a PC or Mac</p>\r\n\r\n<p>‚úî Supports popular video formats including WMV, AVI, MKV, MP4 and MOV formats, so you can store and Watch live video from the Sandisk iXpand Mini OTG USB</p>\r\n\r\n<p>--------------------------------------</p>\r\n\r\n<p>WARRANTY 6 MONTHS BY NSX ERRORS THROUGH STAMP STAMP ON PRODUCTS.</p>', 'san_disk_usb_10.jpg', 500000, 12, 12, '2020-12-15', 0, 0, 3, 4, NULL, 1, 0),
